    Drupal.behaviors.headingNumbers = {
      attach: function attach(context, settings) {
        var indices = [];

        function addIndex() {
          // jQuery will give all the HNs in document order
          jQuery(".main-article-body .main-column h2, .main-article-body .main-column h3:not(.autotitle), .main-article-body .main-column h4", context).each(function (i, e) {
            if ($(".download-box").find(this).length !== 1) {
              var hIndex = parseFloat(this.nodeName.substring(1)) - 1; // just found a levelUp event

              if (indices.length - 1 > hIndex) {
                indices = indices.slice(0, hIndex + 1);
              } // just found a levelDown event


              if (indices[hIndex] === undefined) {
                indices[hIndex] = 0;
              } // count + 1 at current level


              indices[hIndex]++;
              var numbering = "".concat(indices.join("."));
              numbering = "".concat(numbering.substring(1), ". &nbsp; &nbsp;"); // display the full position in the hierarchy

              jQuery(this).html(numbering + jQuery(this).text());
            }
          });
        }

        jQuery(document).ready(function () {
          if ($("article.node--type-article, article.node--type-brief")[0]) {
            addIndex();
          }
        });
      }
    };
    Drupal.behaviors.tocbot = {
      attach: function attach(context, settings) {
        if (jQuery(".main-article-body .main-column h2, .main-article-body .main-column h3, .main-article-body .main-column h4")[0]) {
          // const headingsToRemove = document.querySelectorAll(
          //   ".footnotes-list h3"
          // ); // 17/12/19 there shouldn't be any left
          // headingsToRemove.forEach(function(heading) {
          //   heading.parentNode.removeChild(heading);
          // });
          var slugify = function slugify(text) {
            var from = "/_,:;";
            var to = "aaaaaeeeeeiiiiooooouuuunc------";

            for (var i = 0, len = from.length; i < len; i++) {
              text = text.replace(new RegExp(from.charAt(i), "g"), to.charAt(i));
            }

            return text.toString() // Cast to string
            .toLowerCase() // Convert the string to lowercase letters
            .trim() // Remove whitespace from both sides of a string
            .replace(/\s+/g, "-") // Replace spaces with -
            .replace(/&/g, "-y-") // Replace & with 'and'
            .replace(/[^\w\-]+/g, "") // Remove all non-word chars
            .replace(/\-\-+/g, "-"); // Replace multiple - with single -
          };

          var content = document.querySelector(".main-article-body .main-column");
          var headings = content.querySelectorAll("h2, h3, h4");
          var headingMap = {};
          Array.prototype.forEach.call(headings, function (heading) {
            var id = heading.id ? slugify(heading.id) : slugify(heading.textContent);
            headingMap[id] = !isNaN(headingMap[id]) ? ++headingMap[id] : 0;

            if (headingMap[id]) {
              heading.id = "".concat(id, "-").concat(headingMap[id]);
            } else {
              heading.id = id;
            }
          });

          if ($(".main-article-body .main-column")[0]) {
            // console.log("init tocbot");
            tocbot.init({
              // Where to render the table of contents.
              tocSelector: ".table-of-contents .links-container",
              // Where to grab the headings to build the table of contents.
              contentSelector: ".main-article-body .main-column",
              // Which headings to grab inside of the contentSelector element.
              headingSelector: "h2, h3, h4",
              ignoreSelector: ".toc-ignore",
              scrollSmooth: false
            });
          }

          if ($(".table-of-contents .links-container a")[0]) {
            $(".table-of-contents").addClass("active");
          }

          jQuery("body").on("click", ".table-of-contents .links-container a", function (e) {
            e.preventDefault();
            var navbar = document.querySelector(".sticky-header"); // console.log(e);

            var hash = e.target.hash;
            hash = hash.replace("#", ""); // console.log(hash);

            var scrollTop = getPosition(document.getElementById(hash)); // console.log(scrollTop);

            Velocity(document.body, "scroll", {
              offset: scrollTop.y - navbar.offsetHeight - 20,
              duration: 800
            });
          });
        }
      }
    };
